import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  listContent: {
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'flex-start',
    alignItems: 'center',
    backgroundColor: '#333',
  },
  quantity: {
    fontWeight: 'bold',
    marginRight: '5%',
  },
  name: {
    width: 'auto',
  },
});
